import React from 'react';
import { Pie } from 'react-chartjs-2';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS } from 'chart.js/auto'




function Chart (){

    let dataset=[{
        data:[10,20,30],
        backgroundColor:[
            'red',
            'blue',
            'yellow'
        ]
    }]

    return (
        <div>
            <Pie
            datasetIdKey='id'
            data={{
                labels: ['Jun', 'Jul', 'Aug'],
                dataset:[{
                    data:[10,20,30],
                    backgroundColor:[
                        'red',
                        'blue',
                        'yellow'
                    ]
                }]
            }}
            />
        </div>
    )
}

export default Chart;
